package com.demo.io.stream;

import java.io.FileOutputStream;
import java.io.IOException;
import java.util.Base64;

public class BulkByteStreamHandlerDemo1 {
	
	public static void main(String[] args) {
		
		String[] byteBinarydata = getByteBinarydata();
		
		String path = "resources/images/sample{num}.jpg";
		
		for (int i =0;i<byteBinarydata.length;i++) {
			
			String filePath = path.replace("{num}", String.valueOf(i));
			
			try (FileOutputStream fous = new FileOutputStream(filePath)) {
				
				byte[] imagedata = Base64.getDecoder().decode(byteBinarydata[i]);
				fous.write(imagedata);
				System.out.println("Image created successfully");
			} catch (IOException e) {
				// TODO Auto-generated catch block
				e.printStackTrace();
			}
		}
		
	}
	
	static String [] getByteBinarydata() {
		
		String byteArray [] = new String[6];
		byteArray[0] = "";
		byteArray[1] = "";
		byteArray[2] = "";
		byteArray[3] = "";
		byteArray[4] ="";
		byteArray[5] = "";
		return byteArray;
	}

}
